    false,nt"url": null,nt"notes": "This narrative report for Oak Orchard National
    Wildlife Refuge outlines Refuge accomplishments from May through August of 1962.
    The report begins by summarizing the weather conditions, habitat conditions, and
    water conditions during this period. Wildlife- including migratory birds, upland
    game birds, big game animals, furbearers, predators, rodents, raptors, and reptiles-
    is also covered. The public relations section of the report describes recreational
    uses, Refuge visitors, and Refuge participation. Photographs are attached.",nt"owner_org":
